import React from 'react';
import { Link } from 'react-router-dom';

export default function Details1() {
  return (
    <div className="fakeNews">
          <h3>Stocks, Bonds, Dividends: Working Boys</h3>
          <img src="http://localhost:8080/documents/20123/0/business+calls.jpg/114e5baf-0f60-48ec-e5e6-4aa78946fd0d?t=1644995107560" className="picture" alt="businesscalls" />
          <h4> By Professor Hidgens</h4>
          <p>
          This is a deep cut reference for any Starkid fans out there. We all know that 5 o'clock can't come soon enough. I can't wait to get home to my boys.
          </p>
          <Link to="/">Back</Link>
    </div>
  );
}
